export default function Navbar({ openComponent }) {
  return (
    <>
      <div className="horizontalstyling navbarposition">
        <div onClick={() => openComponent("home")}>Home</div>
        <div onClick={() => openComponent("about")}>About</div>
        <div onClick={() => openComponent("skills")}>Skills</div>
        <div onClick={() => openComponent("works")}>Works</div>
        <div onClick={() => openComponent("experience")}>Experience</div>
        <div onClick={() => openComponent("contactme")}>ContactMe</div>
      </div>
      <hr />
    </>
  );
}
